import Router from 'next/router'
import React from 'react'

export default class Redirect extends React.Component {
  componentDidMount () {
    const {pathname} = Router
    if(pathname == '/' ){
       Router.push('/hello-nextjs')
    }
  }

  render () {
  	return <></>
  }
}
